import React from 'react';
import ReactLoading from 'react-loading';

const Loading = ({ text }) => {
  return (
    <div className="loading">
      <div>
        <p className="loading__text">{text}</p>
        <ReactLoading type={'bars'} color={'white'} height={300} width={175} />
      </div>
    </div>
  );
};

export default Loading;
